import React from "react";
import p5 from "p5";
import P5Wrapper from "react-p5-wrapper";
import sketch from "./Sketch";

function Background() {
  return (
    <div>
      <P5Wrapper sketch={sketch} />
    </div>
  );
}

export default Background;
